sq--src-components-layout-js.query:
query SiteTitleQuery {
  site {
    siteMetadata {
      title
      description
      keywords
    }
  }
  allContentfulLink(sort: {fields: [createdAt], order: ASC}) {
    edges {
      node {
        title
        url
        createdAt
      }
    }
  }
  allContentfulPortfolioItem {
    edges {
      node {
        title
        type
        backgroundImage {
          id
        }
      }
    }
  }
}

sq--src-components-seo-js.query:
query DefaultSEOQuery {
  site {
    siteMetadata {
      title
      description
      author
    }
  }
}
